import 'bootstrap/dist/css/bootstrap.min.css';
import {Container, Navbar, NavDropdown, Nav, Form, FormControl, Button, Card} from 'react-bootstrap';


import Perro from './components/Navbar'


function App() {
  return (
    <div>
      <Perro/>

      <Navbar bg="dark" variant="dark">
  <Container>
    <Navbar.Brand href="#home">Navbar with text</Navbar.Brand>
    <Navbar.Toggle />
    <Navbar.Collapse className="justify-content-end">
      <Navbar.Text>
        Signed in as: <a href="#login">Mark Otto</a>
      </Navbar.Text>
    </Navbar.Collapse>
  </Container>
</Navbar>
    </div> 

  );
}

export default App;
